window.bookSummaryJSON = "<p><b>Zac was alone in the middle of the forest when the world changed....</b></p> <p>The whole planet was introduced to the multiverse by an unfeeling System...or God. A universe where an endless number of races and civilizations fought for power and dominion.&nbsp;</p> <p>Zac finds himself stuck in the wilderness surrounded by deadly beasts, demons, and worse. Alone, lost and without answers, he must find the means to survive and get stronger in this new cut-throat reality.&nbsp;</p> <p>With only a hatchet for his weapon, he'll have to seek out his family before the world collapses...or die trying.&nbsp;</p> <p><b>Experience the start of the hit LitRPG series with nearly 20 million views on Royal Road. For the first time, </b><b><i>Defiance of the Fall</i></b><b> is now available on Kindle, Kindle Unlimited, and Audible, narrated by Pavi Prozcko.</b>&nbsp;</p> <p><b>About the series</b>: Jump into a System Apocalypse story that merges LitRPG elements with Eastern cultivation. Class systems, skill systems, endless choices for progression, it has everything fans of the genre love. Explore a vast universe full of mystery, adventure, danger, and even aliens, where even a random passer-by might hold the power of a god. Follow Zac as he struggles to stake out a unique path to power as a mortal in a world full of cultivators.</p>"; 
